script: |
  super -f text -I q7226.spq | sort > q7226.out

inputs:
  - name: q7226.spq
    data: |
      SELECT DISTINCT - col2 + col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 BETWEEN + 80 * + + col0 * col0 - - col0 AND 94;
  - name: tab1

outputs:
  - name: q7226.out
    data: |
      -21
      -54
      -82
